sys_variable_value.value:
(function execute(inputs, outputs) {
	if(inputs.status_code == '200'){
        var body = JSON.parse(inputs.response);
        outputs.queue_id = body.id;
        var why = body.why;
        if(why == null){
          outputs.build_completed = "True";
          outputs.build_id = body.executable.number;
        } else {
          outputs.build_completed = "False";          
        }
    	outputs.status = "Success";
    }else{
      outputs = new JenkinsErrorHandler().jobErrorHandler(inputs,outputs);
     }
  })(inputs, outputs);

